pub enum DefaultScalarValue {
    Int(i32),
    Float(f64),
    String(String),
    Boolean(bool),
}

pub enum Value<S = DefaultScalarValue> {
    Null,
    Scalar(S),
    List(Vec<Value<S>>),
    Object(Object<S>),
}

pub enum Type<'a> {
    Named(Cow),
    List(Box<Type>),
    NonNullNamed(Cow),
    NonNullList(Box<Type>),
}

pub enum Selection<'a, S = DefaultScalarValue> {
    Field(Spanning<Field>),
    FragmentSpread(Spanning<FragmentSpread>),
    InlineFragment(Spanning<InlineFragment>),
}

pub enum Definition<'a, S> {
    Operation(Spanning<Operation>),
    Fragment(Spanning<Fragment>),
}

pub enum FieldPath<'a> {
    Root(SourcePosition),
    Field(&'a str, SourcePosition, Arc<FieldPath>),
}

pub enum ParseError<'a> {
    UnexpectedToken(Token),
    UnexpectedEndOfFile,
    LexerError(LexerError),
    ExpectedScalarError(&'static str),
}

pub enum TypeType<'a, S: 'a> {
    Concrete(&'a MetaType),
    NonNull(Box<TypeType>),
    List(Box<TypeType>),
}

pub enum GraphQLBatchRequest<S = DefaultScalarValue> where S: ScalarValue {
    Single(GraphQLRequest<S>),
    Batch(Vec<GraphQLRequest<S>>),
}

pub enum GraphQLBatchResponse<'a, S = DefaultScalarValue> where S: ScalarValue
         {
    Single(GraphQLResponse),
    Batch(Vec<GraphQLResponse>),
}
